DROP TABLE IF EXISTS `trip`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `trip` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'pk',
  `title` varchar(256) NOT NULL COMMENT '标题',
  `cover` varchar(128) NOT NULL COMMENT '图片url',
  `start_date` date DEFAULT NULL COMMENT '出发日期',
  `end_date` date DEFAULT NULL COMMENT '结束日期',
  `creator_id` int(11) NOT NULL COMMENT '创建者uid',
  `create_time` datetime NOT NULL COMMENT '创建时间',
  `from_city` int(11) DEFAULT NULL COMMENT '出发地点',
  `difficulty_level` tinyint(4) DEFAULT '0' COMMENT '旅行难度',
  `culture_level` tinyint(4) DEFAULT '0' COMMENT '民俗文化',
  `remote_level` tinyint(4) DEFAULT '0' COMMENT '旅行距离',
  `risk_level` tinyint(4) DEFAULT '0' COMMENT '危险度',
  `content` text NOT NULL COMMENT '内容',
  PRIMARY KEY (`id`),
  KEY `FK_creator_idx` (`creator_id`),
  KEY `FK_trip_from_city_idx` (`from_city`),
  KEY `FK_trip_from_city` (`from_city`),
  CONSTRAINT `FK_trip_creator_id` FOREIGN KEY (`creator_id`) REFERENCES `user` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `FK_trip_from_city_id` FOREIGN KEY (`from_city`) REFERENCES `city` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8;
